import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";


const App = () => {
    return (
        <>
            <div className = "row">
                <div className="col-lg-4 text-center text-danger" >
                    <h1>hello world</h1>
                </div>
                <div className="col-lg-4 text-center text-primary " >
                    <h1>hello world</h1>
                </div>
                <div className="col-lg-4 text-center text-warning " >
                    <h1>hello world</h1>
                </div>
            </div>
        </>
    )
}

export default App;
